// SPDX-License-Identifier: MIT

pragma solidity >=0.5.0 <0.8.0;

import "./ArtProject.sol";
import "@openzeppelin/contracts/access/Ownable.sol";

contract Art is Ownable {

    address public projectTokenAddress;

    uint private lifecycle = 100;
    uint8 private state = 255;
    uint8 private technique = 1;
    uint8 private aesthetics = 1;
    uint8 private usage = 2;
    uint8 private popularity = 1;

    constructor() public {
        projectTokenAddress = address(new ArtProject());
    }

    function newProject(string memory _name, uint8 _age, uint8 _scope) public returns (uint){
        return ArtProject(projectTokenAddress).newProject(
            lifecycle, _name, _age, _scope, state, technique, aesthetics, usage, popularity, msg.sender
        );
    }
}
